import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './CreateGame.css';

const CreateGame = () => {
    const { state } = useLocation();
    const [playerName, setPlayerName] = useState(state ? state.playerName : '');
    const [gameId, setGameId] = useState('');
    const [gameStatus, setGameStatus] = useState('waiting');
    const [secretNumber, setSecretNumber] = useState('');
    const [isSecretNumberSet, setIsSecretNumberSet] = useState(false);
    const [playerJoined, setPlayerJoined] = useState(false);
    const [isHost, setIsHost] = useState(false); // Track if this player is the host
    const navigate = useNavigate();

    useEffect(() => {
        // If no player information exists in state, navigate back to home
        if (!state || !state.playerName) {
            alert('No player information found!');
            navigate('/');
        }
    }, [state, navigate]);

    // Game creation logic: POST request to create game
    useEffect(() => {
        if (playerName && !gameId) {
            axios
                .post('http://localhost:5000/api/games', { players: [playerName] })
                .then(response => {
                    setGameId(response.data.gameId); // Set the game ID from the response
                    setGameStatus('waiting'); // Ensure the status is 'waiting'
                    setIsHost(true); // Player 1 is the host
                })
                .catch(error => {
                    console.error('Error starting the game:', error);
                });
        }
    }, [playerName, gameId]);

    // Handle Player 2 joining the game
    const handlePlayerJoin = () => {
        if (gameId && playerName) {
            axios
                .post(`http://localhost:5000/api/games/join`, { gameId, playerName }) // Pass playerName here
                .then(response => {
                    setPlayerJoined(true);
                    setGameStatus('in-progress'); // Change status when second player joins
                    navigate(`/game/${gameId}`, { state: { playerName: playerName } });
                })
                .catch(err => {
                    console.error('Error joining the game:', err);
                });
        }
    };

    // Secret number validation and setter
    const handleSecretNumberChange = (e) => {
        const value = e.target.value;
        if (value.length <= 4 && /^[0-9]*$/.test(value) && new Set(value).size === value.length) {
            setSecretNumber(value); // Update secret number if it's valid
        }
    };

    // Set the secret number for the current player
    const handleSetSecretNumber = () => {
        if (secretNumber.length === 4) {
            // Submit the secret number to the backend
            axios
                .post('http://localhost:5000/api/games/secret', { gameId, secretNumber })
                .then(response => {
                    setIsSecretNumberSet(true); // Mark the secret number as set
                })
                .catch(err => {
                    console.error('Error setting secret number:', err);
                });
        } else {
            alert('Please enter a valid 4-digit unique number!');
        }
    };

    // Fetch game data after creation or whenever the status changes
    useEffect(() => {
        if (gameId) {
            axios
                .get(`http://localhost:5000/api/games/${gameId}`)
                .then(response => {
                    setGameStatus(response.data.status); // Update game status from server
                })
                .catch(error => {
                    console.error('Error fetching game data:', error);
                });
        }
    }, [gameId]);

    return (
        <div className="game-container">
            <h1>Game ID: {gameId || 'Loading...'}</h1>
            <p>Welcome, {playerName}!</p>
            {gameStatus === 'waiting' && isHost && (
                <>
                    <p>Waiting for Player 2 to join...</p>
                    <button className="button" onClick={handlePlayerJoin}>
                        Simulate Player 2 Join (For Testing)
                    </button>
                </>
            )}

            {gameStatus === 'waiting' && !isHost && (
                <>
                    <p>Waiting for Player 1 to start the game...</p>
                    <button className="button" onClick={handlePlayerJoin}>
                        Join Game
                    </button>
                </>
            )}

            {gameStatus === 'in-progress' && !isSecretNumberSet && (
                <div>
                    <h2>Set a secret number (4 unique digits):</h2>
                    <input
                        type="text"
                        value={secretNumber}
                        onChange={handleSecretNumberChange}
                        maxLength={4}
                        placeholder="Enter secret number"
                    />
                    <button onClick={handleSetSecretNumber}>Set Secret Number</button>
                </div>
            )}

            {gameStatus === 'in-progress' && isSecretNumberSet && (
                <p>Your secret number has been set! Waiting for the game to start...</p>
            )}
        </div>
    );
};

export default CreateGame;
